import './App.css';
import Home from './Components/Options/Home';
import BurgerButton from './Components/SideDrawer/BurgerButton';

class App extends Component {
  render() {
    return (
        <div>
          <head>
            <title>Judy Zhang</title>
          </head>
          <Home />
        </div>
    );
  }
}

export default App;
